import {FormControlLabel, FormLabel, Radio, RadioGroup} from "@material-ui/core";

function App() {
    return (
        <div className="App">
            <header className="header">
               <h1>Projekt ZTBD - Kamil Kubala, Maciej Sp√≥lnik</h1>
            </header>
            <div className="container">
                <div className="radios">
                    <RadioGroup aria-label="gender">
                        <FormLabel component="legend">Twoja Matka</FormLabel>
                        <FormControlLabel control={<Radio />} label={"POST"}/>
                        <FormControlLabel control={<Radio />} label={"GET"}/>
                        <FormControlLabel control={<Radio />} label={"CHUJ"}/>
                        <FormControlLabel control={<Radio />} label={"CIPA"}/>
                    </RadioGroup>
                </div>
            </div>
        </div>
    );
}

export default App;
